import React from 'react';

export default function Item(props) {
  return (
    <div className="row">
      <div class="column">
        <div class="orange-column">{props.item.qnt}</div>
      </div>
      <div class="column">
        <div class="blue-column">{props.item.item}</div>
      </div>
      <div class="column">
        <div class="green-column">{props.item.price}</div>
      </div>
    </div>
  );
}
